import styles from '../components/box.module.css';
function Modal(props) {

    return(
    <div className={styles.modal}>
        <p>
            Are you sure?
        </p>
        <buttons className={styles.btnalt}>Cancel</buttons>
        <buttons className={styles.btn}>Confirm</buttons>
    </div>
    );
}

export default Modal;
